(10, '4.1.1.1', 'Not wearing School ID Card', '1. Verbal or written reprimand by the Prefect of Discipline after\r\ninvestigation.\r\n\r\n2. Disciplinary probation for new students or transferees', 'MINOR'),
(11, '4.1.1.2', 'Eating inside the classroom, chewing bubblegums, etc.', '1. Verbal or written reprimand by the Prefect of Discipline after\r\ninvestigation.\r\n\r\n2. Disciplinary probation for new students or transferees', 'MINOR'),
(12, '4.1.1.3', 'Loitering near the gate, staying or sitting near fire escape, and the like; or any act that may hamper or block flow of human traffic', '1. Verbal or written reprimand by the Prefect of Discipline after\r\ninvestigation.\r\n\r\n2. Disciplinary probation for new students or transferees', 'MINOR'),
