(14, '4.1.1.5', 'Posting of banners, notice, without prior approvalfrom the concerned head of the department', '1. Verbal or written reprimand by the Prefect of Discipline after\r\ninvestigation.\r\n\r\n2. Disciplinary probation for new students or transferees', 'MINOR'),
(15, '4.1.1.6', 'Spitting on the floor, corridors, stairways, or any acts which may result to the unsanitary, dirty or disorderly condition of the campus.', '1. Verbal or written reprimand by the Prefect of Discipline after\r\ninvestigation.\r\n\r\n2. Disciplinary probation for new students or transferees', 'MINOR'),
(16, '4.1.1.7', 'Improper haircut, dyeing of hair (MALE), wearing of earrings, bull cap, wristband, and funk attire.', '1. Verbal or written reprimand by the Prefect of Discipline after\r\ninvestigation.\r\n\r\n2. Disciplinary probation for new students or transferees', 'MINOR'),
