(18, '4.1.1.9', 'Male student entering the comfort rooms for females or vice versa.', '1. Verbal or written reprimand by the Prefect of Discipline after\r\ninvestigation.\r\n\r\n2. Disciplinary probation for new students or transferees', 'MINOR'),
